import React from 'react';
import { ScrollMenu } from 'react-horizontal-scrolling-menu';
import 'react-horizontal-scrolling-menu/dist/styles.css';
import './HomePage.css';

export const HomePage = ({ movies }) => {
  return (
    <div className="horizontal-scroll-wrapper">
      <ScrollMenu
        arrowLeft={<div className="scroll-arrow">{"<"}</div>}
        arrowRight={<div className="scroll-arrow">{">"}</div>}
      >
        {movies.map((movie) => (
          <div className="movie-wrapper" key={movie.sno}>
            <img
              src={movie.imgurl}
              alt={movie.name}
              className="scroll-img"
            />
          </div>
        ))}
      </ScrollMenu>
    </div>
  );
};
